'use strict';
//@@DocInclude
//@@DocBrief("The class provides information for a close market order request")
class CloseMarketOrderRequest {
    tradeId;
    amount;
    timeInForce;
    expirationDate;
    customId;
    rateRange;
    rateRangeFilled;
    constructor() {
        this.rateRange = 0.0;
        this.tradeId = "";
        this.amount = 0;
        this.timeInForce = "";
        this.customId = "";
        this.rateRangeFilled = false;
    }
    getTradeId() {
        return this.tradeId;
    }
    getAmount() {
        return this.amount;
    }
    getTimeInForce() {
        return this.timeInForce;
    }
    getExpirationDate() {
        return this.expirationDate;
    }
    getCustomId() {
        return this.customId;
    }
    getRateRange() {
        return this.rateRange;
    }
    isRateRangeFilled() {
        return this.rateRangeFilled;
    }
}
module.exports = CloseMarketOrderRequest
